import React from 'react'

const MovieSlider = ({movies}) => {
  return (
    <div>
        {movies.map((movie) => (
            <div>
                <img src={movie.image} alt={movie.title} />
            </div>
        ))}
    </div>
  )
}

export default MovieSlider
